import React, { useState } from "react";

const Clothing = ({ label, imageUrl }) => {
  const [isChecked, setIsChecked] = useState(false);
  return (
    <>
      <label
        htmlFor="clothing_item"
        className={`w-28 flex flex-col items-center cursor-pointer hover:bg-[#ccc] rounded-lg p-2 ${
          isChecked ? "border border-green-400" : ""
        }`}
      >
        <img src={imageUrl} alt={label} />
        <p>{label}</p>
      </label>
      <input
        type="checkbox"
        id="clothing_item"
        // className="hidden"
        onChange={() => setIsChecked(!isChecked)}
      />
    </>
  );
};

export default Clothing;
